import { Container, Row, Col, Card } from "react-bootstrap";
import "./Home.css";
import StatisticHome from "./StatisticHome";
import SubHome from "./SubHome";
import { useContext } from "react";
import { DataContext } from "../../Data/DataContext";
import Header from "../../Components/Header/Header";
import { NavLink } from "react-router-dom";
import $ from "jquery";
function Home() {
  const [nav, setNav, admin, setAdmin, user, setUser, clinic, setClinic] =
    useContext(DataContext);
  $("document").ready(function () {
    $(".test").animate({ top: "-10px" }, 1000);
    $(".test").animate({ top: "0px" }, 1000);
  });
  return (
    <div>
      <Header />
      <div style={{ marginTop: "100px" }}>
        <Container className="Home">
          {/* Stack the columns on mobile by making one full-width and the other half-width */}
          <Row>
            <Col xs={12} md={4}>
              <NavLink to="" className="covid">
                <SubHome
                  className="dash"
                  title="COVID-19"
                  subtitle="Who want to get corona test"
                  no={user.num}
                  src="./assets/img/pcr-test.png"
                />
              </NavLink>
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                className="dash"
                title="Nurse"
                subtitle="Managing Nurse"
                no={clinic.num}
                src="./assets/img/nurses.png"
              />
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                className="dash"
                title="Accountant"
                subtitle="Managing Accountant"
                no={user.num + clinic.num}
                src="./assets/img/budget.png"
              />
            </Col>
          </Row>
        </Container>

        <Container className="Home">
          {/* Stack the columns on mobile by making one full-width and the other half-width */}
          <Row>
            <Col xs={12} md={4}>
              <SubHome
                title="Audit"
                subtitle="Managing Audit"
                no={user.num}
                src="./assets/img/audit.png"
              />
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                className="dash"
                title="Reports"
                subtitle="reports"
                src="./assets/img/monitor.png"
              />
            </Col>
            <Col xs={12} md={4}>
              <NavLink to="./a" className="dash">
                <SubHome
                  className="dash"
                  title="Setting"
                  subtitle="setting | dark and light mode"
                  src="./assets/img/setting.png"
                />
              </NavLink>
            </Col>
          </Row>
        </Container>
      </div>
    </div>
  );
}

export default Home;
